import React from 'react';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import './Gallery.css';
import child from '../img/child.jpg';
import children from '../img/children.jpg';
import children_holding_hands from '../img/children_holding_hands.jpg';
import GalleryItem from './GalleryItem';

const Gallery = () => {
  const header = 'Create account'
  const paragraph = 'Create your own personal space - personal or organizational. Add content, publish your thoughts and have fun!'
  return (
    <Container>
      <div className='gallery'>
        <Row>
          <Col md={12} lg={4}>
            <GalleryItem 
              header='Create account'
              paragraph='Create your own personal space - personal or organizational. Add content, publish your thoughts and have fun!'
              url_img={child} 
            />
          </Col>
            {/* <div className='gallery-item'>
              <img src={child} alt="child"/>
              <h1>Create account</h1>
              <p>Create your own personal space - personal or organizational. Add content, publish your thoughts and have fun!</p>
            </div> */}
          <Col md={12} lg={4}>
            <GalleryItem 
              header={header} 
              paragraph={paragraph} 
              url_img={child} 
            />
            {/* <div className='gallery-item'>
              <img src={children} alt="children"/>
              <h1>Socialize</h1>
              <p>Connect with your friends, get to know new people, open new communities or join an existing one. Your journey begins here!</p>
            </div> */}
          </Col>
          <Col md={12} lg={4}>
            <GalleryItem 
              header={header} 
              paragraph={paragraph} 
              url_img={child} 
            />
            {/* <div className='gallery-item'>
              <img src={children_holding_hands} alt="children_holding_hands"/>
              <h1>Help</h1>
              <p>Ask for something you need or offer what you can give. Contribute to the causes you believe in.  Join others in making a difference!</p>
            </div> */}
          </Col>
        </Row>
      </div>
    </Container>
  );
};

export default Gallery;
